// Função para extrair o telefone e formatá-lo corretamente
function extrairDddETelefone(telefone) {
  if (!telefone) return "";

  // Limpa caracteres não numéricos
  const telefoneLimpo = telefone.replace(/\D/g, "");
  let ddd;
  let ddi = "55";
  let telefoneFormatado;

  // Se o telefone já contém o prefixo "+55"
  if (telefoneLimpo.startsWith("55")) {
    ddd = telefoneLimpo.slice(2, 4);
    telefoneFormatado = telefoneLimpo;
  } else {
    ddd = telefoneLimpo.slice(0, 2);

    if (telefoneLimpo.startsWith("351")) {
      return telefoneLimpo;
    }

    if (parseInt(ddd) > 28) {
      telefoneFormatado = ddi + ddd + telefoneLimpo.slice(-8);
    } else {
      telefoneFormatado = ddi + ddd + telefoneLimpo.slice(-9);
    }
  }

  return telefoneFormatado;
}

// Função para formatar a primeira letra de cada palavra em maiúsculo
function formatarPrimeiraLetraMaiuscula(str) {
  if (!str) return "";
  return str
    .toLowerCase()
    .split(" ")
    .map((palavra) => palavra.charAt(0).toUpperCase() + palavra.slice(1))
    .join(" ");
}

// Função para extrair as UTMs do objeto JSON
function extractUTMs(json) {
  const utmParams = {};
  function searchUTMs(obj) {
    for (const key in obj) {
      if (key.startsWith("utm_")) {
        utmParams[key] = obj[key];
      } else if (typeof obj[key] === "object" && obj[key] !== null) {
        searchUTMs(obj[key]);
      }
    }
  }
  searchUTMs(json);
  return utmParams;
}

// Função para traduzir booleanos para Português
function traduzirBooleano(valor) {
  return valor ? "Sim" : "Não";
}

// Função para converter número em reais
function formatarValorEmReal(valor) {
  if (valor === null || valor === undefined || isNaN(valor)) return "";
  return `R$ ${parseFloat(valor).toFixed(2)}`;
}

