function formatPhone(telefone) {
  if (!telefone) return "";

  let telefoneLimpo = telefone.replace(/\D/g, "");

  // Se começa com DDI (ex: 55 ou 351), manter como está
  if (telefoneLimpo.startsWith("55") || telefoneLimpo.startsWith("351")) {
