// Função para extrair e formatar o telefone
function extrairDddETelefone(telefone) {
  if (!telefone) return "";

  const telefoneLimpo = telefone.replace(/\D/g, "");
  const ddd = telefoneLimpo.slice(0, 2);
  const ddi = '55';

  if (telefoneLimpo.startsWith('351')) {
    return telefoneLimpo;
  }

  return telefoneLimpo.length > 10
    ? ddi + ddd + telefoneLimpo.slice(-8)
    : ddi + ddd + telefoneLimpo.slice(-9);
}

// Função para formatar a primeira letra de cada palavra em maiúsculo
function formatarPrimeiraLetraMaiuscula(str) {
  if (!str) return "";
  const palavras = str.toLowerCase().split(" ");
  return palavras.map(word => word.charAt(0).toUpperCase() + word.slice(1)).join(" ");
}

// Função para traduzir booleanos para Português
function traduzirBooleano(valor) {
  return valor ? "Sim" : "Não";
}

// Função para buscar a resposta com fallback
function buscarRespostaPorRef(ref, tipo = "text") {
  const resposta = respostas.find(answer => answer.field.ref === ref);
  if (!resposta) return "Sem informação";

  switch (tipo) {
    case "text":
      return resposta.text || "Sem informação";
    case "choice":
      return resposta.choice?.label || "Sem informação";
    case "boolean":
      return traduzirBooleano(resposta.boolean);
    default:
      return "Sem informação";
  }
}

